  function generateOutboundRates(){
    forwarding_type = $("#outbound_availability_type").val();
    var price;
    var contents = '<table cellpadding="0" cellspacing="0" border="0" class="display">';
    contents += '<tr><th>Country</th><th>Price per minute</th><th>Recipient\'s number begins with</th></tr>';

    if (forwarding_type == "browser") {
      agentLegPrice = 0.003;

      outboundCountryCode = $("#outbound_call_country").val();
      if (!outboundCountryCode) {
        return;
      }
      outboundCountryName = $("#outbound_call_country").text();

      for (var i = 0; i < rateDataPrepared[outboundCountryCode].length; i++) {
        contents += '<tr class=' + ((i % 2 == 0) ? 'even' : 'odd') + '><td class="country">' + rateDataPrepared[outboundCountryCode][i][1] + '</td>';
        outboundLegPrice = Number(rateDataPrepared[outboundCountryCode][i][2].replace(/[^0-9\.]+/g, ""));
        contents += '<td class="price">' + currency.symbol + round_price((outboundLegPrice + agentLegPrice) * currency.rate) + '</td>';
        contents += '<td class="begins_with">' + rateDataPrepared[outboundCountryCode][i][3].split(",").join(", ") + '</td>';
        contents += '</tr>';
      };

    } else {
      agentFwdCountryCode = $("#outbound_agent_forwarding_country").val();
      outboundCountryCode = $("#outbound_call_country").val();
      if (!outboundCountryCode) {
        return;
      }
      agentFwdLowPrice = 100;
      agentFwdHighPrice = 0;

      for (var i = 0; i < rateDataPrepared[outboundCountryCode].length; i++) {
        contents += '<tr class=' + ((i % 2 == 0) ? 'even' : 'odd') + '><td class="country">' + rateDataPrepared[outboundCountryCode][i][1] + '</td>';
        outboundLegPrice = Number(rateDataPrepared[outboundCountryCode][i][2].replace(/[^0-9\.]+/g, ""));
        for (var j = 0; j < rateDataPrepared[agentFwdCountryCode].length; j++) {
          rate = Number(rateDataPrepared[agentFwdCountryCode][j][2].replace(/[^0-9\.]+/g, ""));
          if (rate > agentFwdHighPrice) {
            agentFwdHighPrice = rate;
          }
          if (rate < agentFwdLowPrice) {
            agentFwdLowPrice = rate;
          }
        };
        contents += '<td class="price">' + currency.symbol + round_price((agentFwdLowPrice + outboundLegPrice) * currency.rate) + " - " + round_price((agentFwdHighPrice + outboundLegPrice) * currency.rate) + '</td>';
        contents += '<td class="begins_with">' + rateDataPrepared[outboundCountryCode][i][3].split(",").join(", ") + '</td>';
        contents += '</tr>';
      };
    };

    contents += '</table>';
    contents += '<div style="clear:both;padding: 30px 0 40px;color: #808080;font: 14px PNL;">*Per minute price includes optional call recording, which is priced at $0.003 per minute</div>';

    $("#outbound_rates_table").html(contents);
    $("#outbound_rates_table input").attr("style", "width: 300px; height: 25px; font-size: 14px;");
  };

